        void pictureBox1_MouseClick(object sender, System.Windows.Forms.MouseEventArgs e)
        {
            if (startSetting)
            {
                if (!after_first_click)
                {
                    p1 = new System.Drawing.Point(e.X,e.Y);

                    after_first_click = true;
                }
                else
                {
                    p2 = new System.Drawing.Point(e.X, e.Y);
                    after_first_click = false;
                    startSetting = false;

                    tang = (double)(p2.Y - p1.Y) / (double)(p2.X - p1.X);
                
                }
                this.Text = p1.ToString();
                System.Diagnostics.Debug.WriteLine(p1.ToString());
            }   

            //throw new System.NotImplementedException();
        
        }

